import React from "react";

import { IconButton, Toolbar, Typography, Button, Avatar, InputBase, fade, createStyles, Theme, makeStyles, useTheme } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';

import logo from './../../assets/images/logoGpac.png' 
import LogoGpac from "../LogoGpac";
import NotificationsNoneIcon from '@material-ui/icons/NotificationsNone';
import MyButton from '../Boton'
import SearchIcon from '@material-ui/icons/Search';
import style from '../../assets/css/App.styles' 

const useStyles = makeStyles((theme: Theme) =>
createStyles({
  grow: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    display: 'none',
    [theme.breakpoints.up('sm')]: {
      display: 'block',
    },
  },
  search: {
    position: 'relative',
    borderRadius: theme.shape.borderRadius,
    backgroundColor: fade(theme.palette.common.white, 0.15),
    '&:hover': {
      backgroundColor: fade(theme.palette.common.white, 0.25),
    },
    marginRight: theme.spacing(2),
    marginLeft: 0,
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      marginLeft: theme.spacing(3),
      width: 'auto',
    },
  },
  searchIcon: {
    padding: theme.spacing(0, 2),
    height: '100%',
    position: 'absolute',
    pointerEvents: 'none',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  inputRoot: {
    color: 'inherit',
  },
  inputInput: {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)}px)`,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('md')]: {
      width: '20ch',
    },
  },
  sectionDesktop: {
    display: 'none',
    [theme.breakpoints.up('md')]: {
      display: 'flex',
    },
  },
  sectionMobile: {
    display: 'flex',
    [theme.breakpoints.up('md')]: {
      display: 'none',
    },
  },
}),
);
    const ToolbarMenu :  React.FC<{}> = () => {
      const classes = useStyles();
      const theme = useTheme();
    return (


          <Toolbar style={{backgroundColor:"white",color:"black"}}>
              <img src={logo} style={{height:"30px"}} alt="logo" />

          <Typography variant="h6" className={classes.title}>
            News
          </Typography>
          <div className={classes.search}>
            <div className={classes.searchIcon}>
              <SearchIcon />
            </div>
            <InputBase
              placeholder="Search…"
              classes={{
                root: classes.inputRoot,
                input: classes.inputInput,
              }}
              inputProps={{ 'aria-label': 'search' }}
            />
          </div>
          <NotificationsNoneIcon />
          <label >jonathan</label>
          <IconButton color="inherit" className={classes.searchIcon}>
                <Avatar src="/static/images/avatar/1.jpg" alt="My Avatar" />
             </IconButton>

        </Toolbar>

    );


}

export default ToolbarMenu;
